import React from "react";

const JobsPage = () => {
  return (
    <div className="w-11/12 mt-2  flex ">
      <div className="w-6/12   flex flex-col items-end">
        <div className="w-9/12 h-10 bg-orange-500 rounded-t-lg  flex items-center text-white font-bold ">
          <span className="ml-2">Karışık iş ilanları</span>
        </div>
        <div className="w-9/12 h-screen border overflow-y-scroll">
          <div className="w-full h- bg-white border-b  flex-col">
            WELCOME TO JOB PAGE
          </div>
          
    
        </div>
      </div>
      <div className="w-6/12 bg-white rounded-r-lg overflow-y-scroll h-32">
        sad
      </div>
    </div>
  );
};

export default JobsPage;
